import React from 'react';
import { Container} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';

const HomePage = () => {
  return (
    <div style={{ backgroundColor: '#3500ff', color: 'white', height: '100vh', padding: '2rem 1rem',overflow: "hidden",
        position: "relative" }}>
      <Container fluid >
        <h2 className='tex'> clman</h2>
        <Container fluid >
            <div>
              <div style={{ position: "relative", zIndex: 2 }}>
          <h1
            className="display-1 fw-bold text-start"
            style={{
              fontFamily: "Anton, sans-serif",
              textTransform: "uppercase",
              transform: "perspective(900px) rotateY(-30deg)",
              transformOrigin: "left center",
              lineHeight: 1.1,
              letterSpacing: "-0.02em",
              fontSize: "6rem",
              color: "#000",
              textShadow: "2px 2px 0 #fff",
              wordWrap: "break-word",
            }}
          >
            Studio<br />Mega<br />The<br />Brigade<br />Push<br />Onx
          </h1>
        </div>
            </div>
        </Container>
      <div
        style={{
          position: 'fixed',
          bottom: 80,
          left: 40,
          zIndex: 1000,
        }}
      >
         <div>
              <h1 className='' style={{ fontWeight: '900', lineHeight: '0.8', fontSize: '3rem' }}>VAN<br />HOLTZ<br />CO.</h1>
            </div>
        <NavbarButom />
        </div>
      </Container>
    </div>
  );
};

export default HomePage;
